import React from 'react'

function Card(props){
    return (
                <div class="border border-gray-300 p-6 rounded-lg">
                    <img src = {props.info.image} />
                    <h2 class="text-lg  font-medium title-font mb-2">{props.info.title}</h2>
                    <p class="leading-relaxed text-base">{props.info.description}</p>
                    <button class="border border-indigo-500 bg-indigo-500 text-white rounded-md px-4 py-2 m-2 transition duration-500 ease select-none hover:bg-indigo-600 focus:outline-none focus:shadow-outline">GoogleMap</button>
                </div>
    )
}

export default Card
